    return (
        <>
        {roomList.map((val) => {
            return (
                <Link as={`/${val.roomName}/${val.ip}`} href="/[room]/[ip]">
                    <button>{val.deviceName}</button>
                </Link>
            )
        })}
        </>
    )
}
